import React, {Component} from 'react';
import './Header.css';

const Header = () => { 
    return (
        <div className="Header">
            <div className="Left">
                <div>Menu Place Holder</div>
            </div>
            <div className="Right">
                <LoginButton />
            </div>
        </div>
    );
}

class LoginButton extends Component {
    constructor(props) {
        super(props);

        this.state = {
            clicked : false
        };
    }

    handleClick = () => {
        this.setState({
            clicked : true
        });
    }

    render() {
        return (
             <a onClick={this.handleClick}> Login </a>
        );
    }
}

export default Header;
